import Home from './pages/Home'; // Assuming you have these components
import About from './pages/About';
import Ch2Comp from './pages/Ch2Comp';
import {BrowserRouter as Router} from 'react-router-dom';
import {Routes as Routes} from 'react-router-dom';
import {Route as Route} from 'react-router-dom';
import {useState} from 'react';
import axios from 'axios';
import {Link} from 'react-router-dom';
import styles from './mystyles.module.css'


function App() {
  const [stvar, setMess] = useState('');
  const handleClick = () => {
    axios.get('http://localhost:8080/helphealth12')
    .then(response => setMess(response.data))
  }
  const linksData = [
    { id: 1, text: 'Home', to: '/' },
    { id: 2, text: 'About', to: '/about' },
    ];
  return (
    <Router>
      <div className={styles.bigblue}>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<Ch2Comp name = {stvar}/>} />
        </Routes>
        <nav>
          <ul className="vertical-links">
            {linksData.map((link) => (
              <li key={link.id}>
                <Link to={link.to} onClick = {handleClick}>{link.text}</Link>
              </li>
            ))}
          </ul>
        </nav>
      </div>
    </Router>
  );
}

export default App;

